import { useState } from 'react';
import './App.css';
import Login from './components/signin/signin';
import TopMovies from './components/top-movies/top-movies';
import Navbar from './components/navbar/navbar';
import SingleMovie from './components/single-movie/single-movie';
import SingleStar from './components/single-star/single-star';
import { Routes, Route } from 'react-router-dom';

function App() {
	const [user, setUser] = useState({});

	return (
		<div className="App">
			<Navbar/>
			<div className="content">
				<Routes>
					<Route exact path="/login" element={<Login user={user} setUser={setUser}/>}/>
				</Routes>
				<Routes>
					<Route exact path="/top-movies" element={<TopMovies/>}/>
				</Routes>
				<Routes>
					<Route exact path="/single-movie" element={<SingleMovie/>}/>
				</Routes>
				<Routes>
					<Route exact path="/single-star" element={<SingleStar/>}/>
				</Routes>
			</div>
		</div>
	);
}

export default App;
